import React from "react";
import NavBar from "./NavBar";
import Hero from "./Hero";
import Footer from "./Footer";
import './App.css'
import first from './images/tall-building.jpg';
import second  from './images/waterfall.jpg';
import third from './images/underground-aquarium.jpg'
export default function App() {
    return (
        <div>
           <NavBar />
           <Hero />
           <footer className="footer">
                <Footer 
                        image={first}
                        about="A fascinating building"
                />
                <Footer
                        image={second}
                        about="Gurara Falls at Lekki Phase 2"
                />
                <Footer
                        image={third}
                        about="Underground Aquarium"
                />
           </footer>
        </div>
    );
}
